import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import { Link }  from 'react-router-dom';

function NavBar() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#">BGS 실시간 현황</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} href="#online">온라인현황</Nav.Link>
            <Nav.Link as={Link} href="#match">매치현황</Nav.Link>
            <Nav.Link as={Link} href="#rank">랭크현황</Nav.Link>
            <Nav.Link as={Link} href="#blacklist">비매너유저</Nav.Link>
            <Nav.Link as={Link} href="#youtube">Youtube</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavBar;
